    // También puedes enviar los datos a un servidor o realizar otras acciones
  };





  return (
    <div>
      <h1>Bienvenidos a Alliance</h1>
      <div className='Form'>
      <form onSubmit={handleSubmit}>
          <div className='email'>
            <label htmlFor="email">Email</label>
            <input
              type="email"
              id="email"
              value={email}
              onChange={handleEmailChange}
              required
            />
          </div>
          <div>
            <label htmlFor="password">Contraseña </label> 
            <input
              type="password"
              id="password"
              value={password}
              onChange={handlePasswordChange}
              required
            />
          </div>
        </form>
      </div>
      



      <button onClick={goToHome}>Go to Home</button>
    </div>
  );
}

export default Presentation;
